import React, { Component } from 'react'
import {
    HomeOutlined,
    SettingFilled,
    SmileOutlined,
    SyncOutlined,
    LoadingOutlined,
    SmileTwoTone, HeartTwoTone, CheckCircleTwoTone
} from '@ant-design/icons';
export default class Icons extends Component {
    render() {
        return (
            <div>
                <div >
                    <HomeOutlined />
                    <SettingFilled />
                    <SmileOutlined />
                    <SyncOutlined spin />
                    <SmileOutlined rotate={270} />
                    <LoadingOutlined />
                </div>,
            </div>
        )
    }
}
